import React from "react";
import Cam from "../img/cam.png";
import Add from "../img/add.png";
import More from "../img/more.png";
import Message from "../components/Message";

const Chat = () => {
  return (
    <div className="chat">
      <div className="chatInfo">
        <span>Jane</span>

        <div className="chatIcons">
          <img src={Cam} />
          <img src={Add} />
          <img src={More} />
        </div>
      </div>
    </div>
  );
};

export default Chat;
